import React from 'react';

// import Rate from '../Rate';

import './SearchMovie.css';

const SearchMovie = () => {
  return (
    <div>
      <div className="search-container">
        <input
          type="text"
          placeholder="Type movie name to search"
        
        />
        <div className="rating-search">
         
        </div>
      </div>
    </div>
  );
};

export default SearchMovie;
